import React, { Component } from 'react'

export default class Navbar extends Component {
  render() {
    return <>
    <div className='container-fluid navbar navbar-expand-lg navbar-light bg-info'>
        <a className='navbar-brand text-white p-3 text-lg-start'>START FRAMEWORK</a>
    </div>


    </>
  }
}
